import React, { useState } from 'react';
import { useLocation } from 'react-router-dom';

const Cart = () => {
  const location = useLocation();
  const [quantity, setQuantity] = useState(1);
  const product = location.state?.product; // Optional chaining

  const handleIncreaseQuantity = () => {
    setQuantity((prevQuantity) => Math.min(prevQuantity + 1, 10)); // Limit quantity to 10
  };

  const handleDecreaseQuantity = () => {
    setQuantity((prevQuantity) => Math.max(prevQuantity - 1, 1)); // Prevent negative quantity
  };

  const handleRemoveFromCart = () => {
    // Implement logic to remove product from cart (replace with your cart actions)
    console.log('Product removed from cart'); // Placeholder for now
  };

  if (!product) {
    return (
      <div style={styles.container}>
        <h2>Giỏ hàng của bạn</h2>
        <p>Không có sản phẩm nào trong giỏ hàng.</p>
      </div>
    );
  }

  const totalPrice = (product.price * quantity).toLocaleString('vi-VN', { style: 'currency', currency: 'VND' });

  return (
    <div style={styles.container}>
      <h2>Giỏ hàng của bạn</h2>
      <div style={styles.productContainer}>
        <div style={styles.productImage}>
          <img src={product.image} alt={product.name} style={{ maxWidth: '200px', borderRadius:"20px" }} />
        </div>
        <div style={styles.productDetails}>
          <div style={styles.productName}>{product.name}</div>
          <div style={styles.productPrice}>{product.price.toLocaleString('vi-VN', { style: 'currency', currency: 'VND' })}</div>
          <div style={styles.productQuantity}>
            <label htmlFor="quantity">Số lượng: </label>
            <div style={styles.quantityControls}>
              <button onClick={handleDecreaseQuantity}>-</button>
              <input
                type="number"
                id="quantity"
                name="quantity"
                value={quantity}
                onChange={(e) => setQuantity(Math.max(parseInt(e.target.value, 10), 1))}
                min={1}
                max={10}
                style={{ padding: '5px', borderRadius: '5px', border: '1px solid #ccc', margin: '0 10px' }}
              />
              <button onClick={handleIncreaseQuantity}>+</button>
            </div>
          </div>
          <button style={styles.removeButton} onClick={handleRemoveFromCart}>Xóa khỏi giỏ hàng</button>
        </div>
      </div>
      <div style={styles.totalPriceContainer}>
        <h3>Tổng tiền: {totalPrice}</h3>
        <button style={styles.checkoutButton}>Thanh toán</button>
      </div>
    </div>
  );
};

export default Cart;

const styles = {
  container: {
    padding: '40px',
    backgroundColor: '#f2c2dc',
    maxWidth: '800px',
    borderRadius: '20px',
    margin: '0 auto',
  },
  productContainer: {
    display: 'flex',
    alignItems: 'center',
    marginBottom: '20px',
  },
  productImage: {
    marginRight: '60px',

  },
  productDetails: {
    flex: '1',

  },
  productName: {
    fontSize: '1.5rem',
    fontWeight: 'bold',
    marginBottom: '10px',
  },
  productPrice: {
    fontSize: '1.2rem',
    marginBottom: '10px',
  },
  productQuantity: {
    marginBottom: '20px',
        overflow: 'hidden', // Ensure image stays within bounds

  },
  quantityControls: {
    display: 'flex',
    alignItems: 'center',
  },
  removeButton: {
    backgroundColor: 'red',
    color: 'white',
    padding: '10px 20px',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    marginRight: '10px',
  },
  totalPriceContainer: {
    marginTop: '20px',
    textAlign: 'right',
  },
  checkoutButton: {
    backgroundColor: 'green',
    color: 'white',
    padding: '10px 20px',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
  },
};
